description:
Vicki needs a job. After bouncing around from one odd job to another, she's finally ready for a career. She did a short stint in the army until and had the lesbian experience of a lifetime. Then she moved on to try her hand at nursing, but it seems like wherever she goes; sex seems to follow. Watch this raven-haired beauty use her huge ta-tas and talented mouth to get her what she wants out of life! See what one horny woman and a short skirt will do to get ahead in life.

